import {Button, Card} from "react-bootstrap";

function Footer({text}){
    const style = {
       padding: 40,
       backgroundColor: 'gray',
       color: 'green',
       textAlign: 'center'
    }
    return(
        <footer style={style}>
            {text}

        </footer>
    );
}

export default  Footer;
